/*Table structure for table `tr_tamu` */

DROP TABLE IF EXISTS `tr_tamu`;

CREATE TABLE `tr_tamu` (
  `cIdTamu` varchar(50) NOT NULL,
  `dTglMasuk` datetime DEFAULT NULL,
  `cKdBooking` varchar(30) DEFAULT NULL,
  `dTglBooking` datetime DEFAULT NULL,
  `cFlag` char(2) DEFAULT NULL,
  `cKdCustomer` char(10) DEFAULT NULL,
  `vNmTamu` varchar(100) DEFAULT NULL,
  `cKdTable` int(11) DEFAULT NULL,
  `cJmlTamu` int(11) DEFAULT NULL,
  `cTelp` varchar(20) NOT NULL,
  `cAlamat` text NOT NULL,
  `cEmail` varchar(200) NOT NULL,
  `cStatus` char(1) DEFAULT NULL,
  `cWaiter` int(11) DEFAULT NULL,
  `nPrinted` int(11) DEFAULT NULL,
  `cKdEntity` varchar(3) DEFAULT NULL,
  `cUserCreated` int(11) DEFAULT NULL,
  `dDateCreated` datetime DEFAULT NULL,
  `cUserModify` int(11) DEFAULT NULL,
  `dDateModify` datetime DEFAULT NULL,
  PRIMARY KEY (`cIdTamu`)
