/* Procedure structure for procedure `sp_kartu_stock` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_kartu_stock` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`k1257545`@`localhost` PROCEDURE `sp_kartu_stock`(IN ptglAwal VARCHAR(10),IN ptglAkhir VARCHAR(10))
BEGIN
    SELECT 
    @saldoawal:=IF(@kdbrg<>stk.cKdBarang,stk.nQty_Saldo,@saldoakhir) AS csaldo, 
    @kdbrg:=IF(@kdbrg<>stk.cKdBarang,stk.cKdBarang,@kdbrg) AS cbrg,
    CASE  
      WHEN stk.JnsTrx = 'IN_BBM' THEN 'GR'  
      WHEN stk.JnsTrx = 'ADJUST' THEN 'ADJUSTMENT'  
      WHEN stk.JnsTrx = 'OUT_RETUR' THEN 'RETURN'  
      WHEN stk.JnsTrx = 'OUT_PESAN' THEN 'ORDER'  
    ELSE 'BEGIN' END AS cJenisTrx,  
    stk.cTrx, stk.JnsTrx, stk.cnotrans, stk.dtgltrans, stk.cKdBarang, stk.vNamaBarang, stk.cSatuan,  
    @saldoawal AS nQty_SaldoAwal, stk.nQty_In, stk.nQty_Out, @saldoakhir:=@saldoawal+stk.nQty_In+stk.nQty_Out AS nQty_SaldoAkhir
    FROM (	
      SELECT tbl.cTrx, tbl.JnsTrx, tbl.cnotrans, tbl.dtgltrans, tbl.cKdBarang, brg.vNamaBarang, tbl.cSatuan,
      SUM(tbl.nQty_Saldo) AS nQty_Saldo,
      CASE  
	WHEN tbl.JnsTrx = 'IN_BBM' THEN SUM(tbl.nQty_Trans)  
	WHEN tbl.JnsTrx = 'ADJUST' AND SUM(tbl.nQty_Trans) > 0 THEN SUM(tbl.nQty_Trans)  
      ELSE 0 END AS nQty_In,  
      CASE  
	WHEN tbl.JnsTrx = 'OUT_RETUR' THEN SUM(tbl.nQty_Trans)  
	WHEN tbl.JnsTrx = 'OUT_PESAN' THEN SUM(tbl.nQty_Trans)  
	WHEN tbl.JnsTrx = 'ADJUST' AND SUM(tbl.nQty_Trans) < 0 THEN SUM(tbl.nQty_Trans)  
      ELSE 0 END AS nQty_Out
      FROM ( 
	SELECT
	CASE WHEN ks.dtgltrans < STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN '00'  
	ELSE 'TR' END AS cTrx,   
	CASE WHEN ks.dtgltrans < STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN 'Saldo Awal'  
	ELSE  ks.JnsTrx END AS JnsTrx,   
	CASE WHEN ks.dtgltrans < STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN 'Saldo Awal'  
	ELSE CONCAT('''',ks.cnotrans) END AS cnotrans,  
	CASE WHEN ks.dtgltrans < STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN DATE_ADD(STR_TO_DATE(ptglAwal,'%Y-%m-%d'), INTERVAL -1 DAY)  
	ELSE ks.dtgltrans END AS dtgltrans, 
	ks.cKdBarang, ks.cSatuan,
	CASE WHEN ks.dtgltrans < STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN  
	SUM(ks.nQtyBBM+ks.nQtyRetur+ks.nQtyPesan+ks.nQtyAdjust)
	ELSE 0 END AS nQty_Saldo,   
	CASE WHEN ks.dtgltrans >= STR_TO_DATE(ptglAwal,'%Y-%m-%d') THEN  
	SUM(ks.nQtyBBM+ks.nQtyRetur+ks.nQtyPesan+ks.nQtyAdjust)  
	ELSE 0 END AS nQty_Trans
	FROM vw_kartu_stock ks
	WHERE ks.dtgltrans <= STR_TO_DATE(ptglAkhir,'%Y-%m-%d')
	GROUP BY ks.JnsTrx, ks.dtgltrans,ks.cKdBarang, ks.cSatuan
       ) tbl
       LEFT JOIN k1257545_duta_mst.ms_barang brg ON brg.cKdBarang = tbl.cKdBarang       
       GROUP BY tbl.cTrx, tbl.JnsTrx, tbl.cnotrans, tbl.dtgltrans, tbl.cKdBarang, tbl.cSatuan
    ) stk, (SELECT @saldoawal:=0,@saldoakhir:=0,@kdbrg:='') n 
    ORDER BY stk.cKdBarang, stk.cTrx, stk.dtgltrans;
    END */$$
DELIMITER ;

